import React from "react";

function Login() {
  return(


<div className="loginPage">

<h1 className="loginString">log in</h1>
<div className="inputLogin">

<input type="email" className="firstInput"  />
<input type="text"className="secondInput" />


</div>

</div>



)
}

export default Login;
